import React from "react";
import s from "./Dialogs.module.css";
import { NavLink } from "react-router-dom";

const DialogItem = (props) => {
  return (
    <div className={s.dialog + " " + s.active}>
      <NavLink to={"/dialog/" + props.id}>{props.name}</NavLink>
    </div>
  );
};

const Message = (props) => {
  return <div className={s.message}>{props.message}</div>;
};

const Dialogs = (props) => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogsItems}>
        <DialogItem name="Anya" id="1"></DialogItem>
        <DialogItem name="Vova" id="2"></DialogItem>
        <DialogItem name="Misha" id="3"></DialogItem>
        <DialogItem name="Dima" id="4"></DialogItem>
        <DialogItem name="Grisha" id="5"></DialogItem>
      </div>
      <div className={s.messages}>
        <Message message="Hi"></Message>
        <Message message="Yo"></Message>
        <Message message="Bye"></Message>
      </div>
    </div>
  );
};

export default Dialogs;
